import React, { Component } from 'react';


class Login extends Component {

    render(){
        return(
            <div class="tab-content">
          
                          
              <div id="menu1" class="tab-pane fade in active"/>
               
               <center>
              <h2  style="color: #A5D6A7;">ROLE MANAGEMENT</h2></center>
                  <div class="container">
                          <div class="panel panel-default">
                                  <div class="panel-heading">
                                      <h4><u><b>Create Role</b></u></h4>
                              
                                  </div>
                                  <div class="panel-body">
                                  
                                 Role Name: <input type="text" name="fname" id="fname" placeholder="Enter Role Name" /><br/><br/>
                               
                      
                                  </div>
                                  <div class="panel-footer" name="a1" style="border-left: 25px;">
                                  <button onclick="addRow();" class="btn btn-success">Save</button>
                                  <button type="button" class="btn btn-danger">Cancel</button>    
                                  </div>
                          </div>
                          </div>
                  </div>
        );
    }
  
}

export default Login;
